import React, {Component} from "react"
import Entertainer from "../src/components/Entertainer"

const entertainers = [
  {name:"아이유", job:"가수,배우", image:"data:image/jpeg;base64,"},
  {name:"박보영", job:"배우", image:"data:image/jpeg;base64,"},
  {name:"유재석", job:"개그맨", image:"data:image/jpeg;base64,"},
]

export default class App extends Component{
  
  render(){
    return(
      <div>
        <div>
            <Entertainer name={entertainers[0].name} job={entertainers[0].job} image={entertainers[0].image}></Entertainer>
            <Entertainer name={entertainers[1].name} job={entertainers[1].job} image={entertainers[1].image}></Entertainer>
            <Entertainer name={entertainers[2].name} job={entertainers[2].job} image={entertainers[2].image}></Entertainer>
        </div>
        <div>
            {entertainers.map(entertainer=>{
                return(<Entertainer name={entertainer.name} job={entertainer.job} image={entertainer.image}> </Entertainer>)})}
        </div>
      </div>

    )
  }
}